import { View, Text, StyleSheet } from "react-native";

const List = () => {
  return (
    <View style={styled.ListContainer}>
      
    </View>
  );
};

const styled = StyleSheet.create({
  ListContainer: {
    borderColor: "red",
    borderWidth: 1,
    width: "100%",
    height: "80%",
  },
  ListText: {
    fontSize: 24,
    color: "black",
  },
});

export default List;
